query TagsQuery(
  $tag: String!
) {
  allMarkdownRemark(limit: 2000, sort: {fields: [frontmatter___date], order: DESC}, filter: {frontmatter: {tags: {eq: $tag}}}) {
    edges {
      node {
        frontmatter {
          title
        }
        fields {
          slug
        }
      }
    }
  }
}

query PostQuery(
  $slug: String!
) {
  markdownRemark(fields: {slug: {eq: $slug}}) {
    html
    excerpt
    frontmatter {
      title
      tags
      image {
        childImageSharp {
          resize(width: 1000, height: 420) {
            src
          }
          fluid(maxWidth: 786) {
            ...GatsbyImageSharpFluid
          }
        }
      }
    }
  }
  site {
    siteMetadata {
      siteUrl
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

query ListQuery {
  allMarkdownRemark(sort: {order: DESC, fields: [frontmatter___date]}) {
    edges {
      node {
        fields {
          slug
        }
        excerpt(pruneLength: 250)
        frontmatter {
          date(formatString: "MMMM Do YYYY")
          title
        }
      }
    }
  }
}

